import React from 'react';
import {Nav, Navbar} from 'rsuite';
import 'rsuite/dist/styles/rsuite-default.css';
  type headerPropsV = {
    style?: any;
    appearance?: 'default' | 'inverse' | 'subtle';
    componentClass?: React.ElementType;
    headerData?: any[];
    headerDataRight?: any[];
    logo?: any;
  };
  export const HeaderV = (props: headerPropsV) => {
    const {
      headerData
    } = props;
    const _getHeader = () => {
      const _tempData: any = [];
      Array.isArray(headerData) &&
        headerData.forEach(item => {
          _tempData.push(
            <Nav.Item style={{borderRadius: '100px'}} href={item.href}>
              {item.title}
            </Nav.Item>,
          );
        });
      return _tempData;
    };
    const _rightHeaderRight = () => {
      const {
        headerDataRight
      } = props;
      const _tempRightData: any = [];
      Array.isArray(headerDataRight) &&
        headerDataRight.forEach(item => {
          _tempRightData.push(
            <Nav.Item style={{borderStyle: 'solid', borderRadius: '100px'}} href={item.href}>
              {item.title}
            </Nav.Item>,
          );
        });
      return _tempRightData;
    };
    return (
      <Navbar
        style={{
          backgroundColor: 'transparent',
          width: '80vw',
          zIndex: 1,
          position: 'absolute',
          top: '50px',
          left: '200px',
          color: 'whitesmoke',
          fontWeight: 'bold',
        }}
      >
        <Navbar.Header>
          <a
            href="#"
            className="navbar-brand logo"
            style={{padding: '18px 20px', display: 'inline-block', border: ''}}
          >
            <img width="25px" height="25px" src={props?.logo}></img>
          </a>
        </Navbar.Header>
        <Navbar.Body>
          <Nav>{_getHeader()}</Nav>
          <Nav pullRight>{_rightHeaderRight()}</Nav>
        </Navbar.Body>
      </Navbar>
    );
  };
